e drew was, 'Hallelujah'\".\n\nAnd love to anybody else who left this Earth before their time.\n\n\nFrom the words of the AVATAR KALKI himself:\n\nTHIS VIDEO HAS NO RELIGIOUS AFFILIATION. NEITHER DOES THE SONG. A SONG CANNOT HAVE AN AFFILIATION TO A RELIGION - PEOPLE DO. THE SONG IS NEUTRAL-. IT MEANS WHATEVER -YOU CHOOSE TO LABEL IT AS IN YOUR OWN MIND... BUT DO NOT BULLY OTHERS JUST BECAUSE THEY MAY HAVE A DIFFERENT PERSPECTIVE AS YOU...\". \n\nI will NOT stand for RACISM, RELIGIOUS INTOLERANCE, BIGOTRY, OR ANY OTHER DISCRIMINATION THAT TEARS AWAY AT THE FABRIC THAT IS OUR HUMANITY!\n\nIncluding the discriminators. They're people too. BUT BAD PEOPLE.\n\nYou can also Follow me on Twitter :D : @TrueAvatarKalki\nAnd The Facepages: peaceoverall \nAnd Last.FM - evanritter1\n\nAND SUBSCRIBE TO MY YOUTUBE MEGACHANNEL - where I am starting a project where ANY AND EVERY ARTIST/MUSICIAN/ACTOR/PRODUCER/CHEF/DESIGNER/COMEDIAN/PERSONALITY CAN POST THEIR OWN VIDEOS ON MY MEGA CHANNEL...\n\nUtilize me as \"The Great Avatar Kalki of Humanity\" \n\nand the thousands and thousands of subscribers that have already figured out\n\nthat I AM THE REINCARNATION OF SRI KRISHNA!.... ;D\n\nJust wait until you see what happens next. :3\n\n\n'Cos this time, instead of me being a BLUE INDIAN...\n\nI'll come in the form of a FLAMING WHITE GINGER CHEROKEE INDIAN...\n\nc wut I did there? :D \n\n \u0026 I'd love to hear what this song means to you and your loved ones.","commandRuns":[{"startIndex":94,"length":8,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJoBENzXBBgOIhMIoZyo8vfmjwMVDwxoCB3dgB3lygEEfnYBPQ==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/thelord","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gULCgd0aGVsb3JkGAE%3D"}}},"loggingDirectives":{"trackingParams":"CJoBENzXBBgOIhMIoZyo8vfmjwMVDwxoCB3dgB3l"}},{"startIndex":378,"length":28,"onTap":{"innertubeCommand":{"clickTrackingParam
